webpackJsonp([54707946475366],{322:function(A,e){A.exports={data:{markdownRemark:{html:'<p>After winning the second prize at the Lydec Hackathon organized by Screendy.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/team-d83e313e76fba751d22391697cbba48d-0f319.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Team"\n        title=""\n        src="/static/team-d83e313e76fba751d22391697cbba48d-5025c.jpeg"\n        srcset="/static/team-d83e313e76fba751d22391697cbba48d-097a5.jpeg 270w,\n/static/team-d83e313e76fba751d22391697cbba48d-d02ea.jpeg 540w,\n/static/team-d83e313e76fba751d22391697cbba48d-5025c.jpeg 1080w,\n/static/team-d83e313e76fba751d22391697cbba48d-0f319.jpeg 1600w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/prize-ce15b322cf326265d77ecff1228fa5e3-6f400.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.25%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Me holding the prize"\n        title=""\n        src="/static/prize-ce15b322cf326265d77ecff1228fa5e3-5025c.jpeg"\n        srcset="/static/prize-ce15b322cf326265d77ecff1228fa5e3-097a5.jpeg 270w,\n/static/prize-ce15b322cf326265d77ecff1228fa5e3-d02ea.jpeg 540w,\n/static/prize-ce15b322cf326265d77ecff1228fa5e3-5025c.jpeg 1080w,\n/static/prize-ce15b322cf326265d77ecff1228fa5e3-6f400.jpeg 1280w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I got invited to join the student partner program of Screendy — thanks to Mehdi Alaoui (the Founder &#x26; CEO of Screendy) — to help the participants during the international HPS hackathon hosted in Marrakesh. Two of my friends who live in my hometown got an invite to participate too, so we took the road to Marrakesh, we arrived after 12 hours of travel lol, we took some pictures of some great places there.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/marrakech-584c4a23561d08501cc3c8133a3423c6-e70b7.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Koutoubia Marrakech"\n        title=""\n        src="/static/marrakech-584c4a23561d08501cc3c8133a3423c6-5025c.jpeg"\n        srcset="/static/marrakech-584c4a23561d08501cc3c8133a3423c6-097a5.jpeg 270w,\n/static/marrakech-584c4a23561d08501cc3c8133a3423c6-d02ea.jpeg 540w,\n/static/marrakech-584c4a23561d08501cc3c8133a3423c6-5025c.jpeg 1080w,\n/static/marrakech-584c4a23561d08501cc3c8133a3423c6-66465.jpeg 1620w,\n/static/marrakech-584c4a23561d08501cc3c8133a3423c6-7862b.jpeg 2160w,\n/static/marrakech-584c4a23561d08501cc3c8133a3423c6-e70b7.jpeg 3024w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We waited for others at the train station, we then got transferred to the Palmeraie resorts Hotel. I met again the SSP team who were really amazing &#x26; nice to me, we prepared everything (badges, shirts….) to welcome 80 participants from 20 countries, 20 HPS clients &#x26; partners, 30 HPS employees, After we collected more than 40 ideas from the participants, we chose 15 ideas which were interesting and the ideas’ holders made their teams of 4 to 5 members (Designer, Developer, Entrepreneur, Marketer &#x26; a HPS employee) then the hackathon started which ended after 48 hours, thanks to HPS for offering to the SSP team 3 nights at the Wazo Hotel which was really good.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/code-4a5e69a981d529971dd94a72f96ad3f6-607e3.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Code anytime & anywhere"\n        title=""\n        src="/static/code-4a5e69a981d529971dd94a72f96ad3f6-5025c.jpeg"\n        srcset="/static/code-4a5e69a981d529971dd94a72f96ad3f6-097a5.jpeg 270w,\n/static/code-4a5e69a981d529971dd94a72f96ad3f6-d02ea.jpeg 540w,\n/static/code-4a5e69a981d529971dd94a72f96ad3f6-5025c.jpeg 1080w,\n/static/code-4a5e69a981d529971dd94a72f96ad3f6-66465.jpeg 1620w,\n/static/code-4a5e69a981d529971dd94a72f96ad3f6-7862b.jpeg 2160w,\n/static/code-4a5e69a981d529971dd94a72f96ad3f6-711c0.jpeg 3240w,\n/static/code-4a5e69a981d529971dd94a72f96ad3f6-607e3.jpeg 4032w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/view-1457cb2e0fdc60fd8df5b94783c62f53-607e3.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Nice view from the hotel room"\n        title=""\n        src="/static/view-1457cb2e0fdc60fd8df5b94783c62f53-5025c.jpeg"\n        srcset="/static/view-1457cb2e0fdc60fd8df5b94783c62f53-097a5.jpeg 270w,\n/static/view-1457cb2e0fdc60fd8df5b94783c62f53-d02ea.jpeg 540w,\n/static/view-1457cb2e0fdc60fd8df5b94783c62f53-5025c.jpeg 1080w,\n/static/view-1457cb2e0fdc60fd8df5b94783c62f53-66465.jpeg 1620w,\n/static/view-1457cb2e0fdc60fd8df5b94783c62f53-7862b.jpeg 2160w,\n/static/view-1457cb2e0fdc60fd8df5b94783c62f53-711c0.jpeg 3240w,\n/static/view-1457cb2e0fdc60fd8df5b94783c62f53-607e3.jpeg 4032w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I helped more than 2 teams on the Design part &#x26; on explaining to them how to use the Screendy Platform &#x26; I explained to my friends’ team that it’s all about the pitch &#x26; to clarify the idea to the jury is the most important part, 48 hours ended and it was time to pitch in public, the decision was made that night but privately and everyone was sent to the Wazo Hotel to have some rest until the day after on the morning when the Powercard users meeting has started is when the winners were announced &#x26; got their prizes :</p>\n<ul>\n<li>First prize : 10 000$ won by Pic &#x26; Pay (the bixby feature on the samsung s8)</li>\n<li>Second prize : 5000$ won by Fill me Up (the team I helped, providing gas stations with best prices on the map)</li>\n<li>Third prize : 3000$ won by Mybills (pay your bills instantly with one click)</li>\n<li>Fourth prize : 1000$ won by EPS (my friends’ team, the Iris recognizer to confirm payment)</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-607e3.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="A logo I designed for that team"\n        title=""\n        src="/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-5025c.jpeg"\n        srcset="/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-097a5.jpeg 270w,\n/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-d02ea.jpeg 540w,\n/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-5025c.jpeg 1080w,\n/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-66465.jpeg 1620w,\n/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-7862b.jpeg 2160w,\n/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-711c0.jpeg 3240w,\n/static/fillme-9c80405c5952c266bb9adceb70f1e4e9-607e3.jpeg 4032w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/awards-c381cb994d066ba491682cf36d0ac2e0-607e3.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 1080px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Announcing the winners"\n        title=""\n        src="/static/awards-c381cb994d066ba491682cf36d0ac2e0-5025c.jpeg"\n        srcset="/static/awards-c381cb994d066ba491682cf36d0ac2e0-097a5.jpeg 270w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-d02ea.jpeg 540w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-5025c.jpeg 1080w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-66465.jpeg 1620w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-7862b.jpeg 2160w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-711c0.jpeg 3240w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-607e3.jpeg 4032w"\n        sizes="(max-width: 1080px) 100vw, 1080px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            null\n          </div>\n          </div>\n<p>In a nutshell, that was the best hackathon so far powered by Screendy in Morocco, here’s a video that shares more details:</p>',timeToRead:2,frontmatter:{date:"April 10, 2017",edited:null,path:"/hps-hackathon",title:"HPS Hackathon",next:"/never-work-for-free",id:3,thumbnail:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3333333333333333,src:"/static/awards-c381cb994d066ba491682cf36d0ac2e0-f2ac0.jpeg",srcSet:"/static/awards-c381cb994d066ba491682cf36d0ac2e0-567e3.jpeg 158w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-c3206.jpeg 315w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-f2ac0.jpeg 630w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-0c4a5.jpeg 945w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-211f3.jpeg 1260w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-0150a.jpeg 1890w,\n/static/awards-c381cb994d066ba491682cf36d0ac2e0-16bdb.jpeg 4032w",sizes:"(max-width: 630px) 100vw, 630px"}}}}}},pathContext:{}}}});
